import React, { useState } from "react";
import About from './about'

const AboutBtn=()=>{

    const [open,setOpen]=useState(false);

    const aboutOpen=()=>{
        setOpen(prevstate=>!prevstate)
    }
    console.log(open)
    return(
        <>
            <button className="aboutbtn"
                    onClick={()=>aboutOpen}>ABOUT
            </button>

            {open ? (
                <About />
            ):(
                <></>
                )}
        </>
    );
}

export default AboutBtn;
